The development will comprise:
(A) The demolition of the remains of the former dwelling house on this site;
(B) The construction of 2 no. 3 bedroom, 2 storey houses and 1 no. 2 bedroom, 2 storey house;
(C) The construction of new access road ( cul-de-sac) off Hawthorn Avenue, footpath and car parking area (4 no. car parking spaces) to service the proposed new dwellings and
(D) Associated site works.

PROTECTED STRUCTURE:
The development will include:
- Removal of existing non-original conservatory extension (14 sq.m) to the rear;
- Construction of new garden room (24 sq.m); part of the roof of which is a passage to provide access to the garden via an external stairs;
- Internal and external modifications to the existing dwelling including: new openings at first and second floor, modification of existing first floor window to the rear, addition of some new partitions and removal of mainly non-original internal partitions, relocation of kitchen and enlarged openings to the garden room at ground floor;
- Repair and repointing of brickwork to front elevation;
- Repair of the side boundary wall;
- New rooflight to inner facing rear roof serving master bedroom wardrobe area;
- General refurbishment of the existing dwelling including repairs as required to the facades and roof;
- Associated works, conservation, repair and ancillary works.

PROTECTED STRUCTURE:
Joint Receivers acting for Tora Company Ltd. (in Receivership and In Liquidation) intend to apply for permission for development at a site known as The Woolstore (a Protected Structure). The development consists of refurbishment, conversion and extension of existing disused Woolstore building, a Protected Structure (RPS 5837) and a change of use to Ground Floor Café unit of 466.69 sq.m and office floor space at First, Second and additional third loft level inclusive comprising of 1182.89 sq.m. The refurbishment and conversion works to the existing structure are to include construction of 
- new structural floor slabs with suspended floors to ground,first and second floors
- new structural support columns and beams as required and retention of existing cast-iron columns, timber floor beams and stone quoin supports; 
-insertion of new sanitary facilities to Ground, First and Second Floors; 
-construction of new partial Loft- level floor slab;
-elevation opening remodelling and additional Ground floor Elevation openings to West Elevation;
-demolition of minor internal dividing walls and existing timber staircase;
-retention and remodelling of major internal rubble stone dividing wall;
-refurbishment and replacement where required of existing timber window fenestration and stone cills;
-refurbishment of existing brick and stone external and internal facades;
-insertion of new Fire Escape Staircase;
-refurbishment and strengthening works to existing timber roof trusses;
-reinstatement of original Blue Bangor slate roof on insulated roof build-up and reinstatement of stone parapet-capping to gable ends;
-5 no. new glazed box dormer windows with standing seam metal roof;
-new ducts and risers for provision of M&E services and Plant Rooms to both Ground Floor and Roof Space with associated boiler flu, external louvres and cowls;
-conversion of existing single-storey pitched roof building to ESB sub-station including remodelled door openings to East street elevation.
The extension works are to include: new glazed extension Ground Floor Entrance Lobby, Switch Room, Staircase and Lift to East Elevation with existing brickwork walls and openings to North-East corner boundary remodelled as required; new glazed extension Office at Second Floor to South Elevation with accessible Roof Terrace over; new Plant and Switch Rooms and external screened Plant Enclosure and Bin Storage facilities. 
The proposed development also includes for external site hard landscaping works, bicycle storage facilities, remodelled Eastern boundary stone wall to include new sliding gate, openings and signage and associated site development works.
This application relates to a proposed development within the North Lotts and Grand Canal Dock SDZ planning scheme area.

The development will consist of:
(1) Demolition of a single-storey kitchen extension to the rear of the property;
(2) Construction of a new 2-storey extension to the rear of the property and all associated site development works.

The development will consist of:
(i) construction of a first floor level and raising of the roof to create a two-storey dwelling house;
(ii) provision of 1 no. roof light on the western roofslope and 2 no. roof lights on eastern roofslope;
(iii) alterations to fenestration on existing rear elevation of the dwelling;
(iv) construction of a part single, part two-storey side and rear extension following demolition of an existing attached single-storey garage and store;
(v) demolition of a single-storey shed attached to west side elevation and conservatory attached to the rear elevation of the dwelling;
(vi) widening of existing vehicular entrance on Bushy Park Road;
(vii) provision of two off-street car parking spaces;
(viii) landscaping, SuDS drainage and all associated site works.

William O'Riordan and Declan MacDonald, Pricewaterhouse Coopers, One Spencer Dock, North Wall Quay, Dublin 1, Joint Statutory Receivers, acting on behalf of Wintertide Ltd. (In Receivership) intends to apply for planning permission for development at a site of 1.1 ha. at Upper Mayor Street and 113-115 Sheriff Street, Dublin 1. The site is bounded by Upper Mayor Street/ Point Village Square to the South, Sheriff Street to the North, a proposed new north-south street to the West and existing north-south street adjacent to the Point Village District Centre to the East. The site is located within City Block 5, as identified in the North Lotts & Grand Canal Dock SDZ Planning Scheme. The development consists of the demolition of all existing structures on the site and the construction of two student accommodation blocks (Block 5A and Block 5C) with a total gross floor area of 31,447m2 (including basement), containing a total of 970 bedspaces associated ancillary active ground floor uses onto Mayor Street/Point Village Square and Sheriff Street. The detailed description of the development is set out below: 
Block 5C onto Upper Mayor Street/Point Village Square; 
1. A part 7 storey residential building stepping down to 6 storey all within a perimeter block around a raised central landscaped courtyard over a part basement. Block 5C has a total gross floor area of 13,029m2 (including basement) and accommodates a total of 359 bedspaces; 
2. Ground floor level accommodating a management office and reception, student amenity space, storage, laundry, ancillary circulation areas, plant and student accommodation; 
3. The ground floor level also accommodates 1 no. retail/retail services/cafe/restaurant/medical unit/cultural unit with a total 851m2 gross internal area (with an option to sub-divide to a maximum of 6 no. total units) facing onto Mayor Street/Point Village; 
4. Part basement -1, of c.781m2, level containing 250 no. bicycle parking spaces accessed via dedicated controlled ramp, student gym, ancillary store, plant and waste management areas; 
5. Ground level retail service yard to be accessed from existing north-south street adjoining the Point Village District Centre.
Block 5A onto Sheriff Street; 
1. A 7 storey residential building all within a perimeter block around a central landscaped courtyard over a part basement. Block 5A has a total gross floor area of 18,418m2 (including basement) and accommodates a total of 611 bedspaces; 
2. Ground floor level accommodating a management office and reception, student amenity space, storage, laundry, ancillary circulation areas, plant, and student accommodation; 
3. The ground floor level also accommodates an Enterprise Unit fronting onto Sheriff Street of 388m2 gross internal area; 
4. Part basement -1 level, of c.909m2, and containing 204 no. bicycle parking spaces accessed via dedicated controlled ramp, student gym, ancillary store, plant and waste management areas. 
Both blocks are accessed via controlled entrances on a new east-west pedestrian route between the two blocks (which also provides for service and emergency vehicle egress/access). The new pedestrian route also allows for two disabled car-parking spaces. The proposed development is accessed from Sheriff Street via the proposed new North-South street connecting Sheriff Street to North Wall Quay (Planning Application Reg. Ref. DSDZ3630/15).
Permission is also sought for the provision of new public realm fronting onto Point Village Square. The public realm will contain a shared surface to maintain existing access to the Gibson Hotel and connection to the existing north-south street adjoining the Point Village District Centre. Permission is also sought for hard and soft landscaping, boundary treatments, signage and all ancillary site and development works. The proposed development includes all associated and ancillary works, including site development works. This application relates to a proposed development within the North Lotts & Grand Canal Dock SDZ Planning Scheme area.

A mixed use residential student accommodation development and retail development. The proposed development will consist of:
(1) the demolition of the existing buildings and structures on site;
(2) the construction of a total of 37 no. student accommodation units (218 bedspaces) with ancillary laundry rooms, store rooms, plant rooms, student relaxation/ recreational rooms and student office across 3 no. individual 4 storeys blocks (Block A, Block B and Block C), with balconies/ terrace on the eastern elevation of Block A;
(3) 1 no. Class 1 retail unit (130 sq.m GFA) and 1 no. student chillout area (109 sq.m GFA) located within ground floor of Block C;
(4) 11 no. car parking spaces all at surface level;
(5) 218 no. bicycle parking spaces consisting of 120 no. open rack spaces and 98 enclosed spaces;
(6) waste storage areas;
(7) vehicular access to the site will be from Prussia Street with pedestrian entrance from Prussia Street and via a new controlled access gate on St. Joseph's Road (to replace existing gate);
(8) 1 no. 15 sq.m ESB substation;
(9) signage; and
(10) all associated landscaping (including outdoor gym area), boundary treatment, engineering and site development works necessary to facilitate the proposed development.

PROTECTED STRUCTURE: The development will consist of the following works to the three storey dwelling: - Demolition of single storey extension to rear.
- Construction of a new single storey extension with rooflights to the rear with new and widened opes proposed to link this element to the main house;
- Construction of a dormer window and new rooflight at attic level in the main roof;
- Side and rear elevation changes as well as refurbishment and internal amendments to the existing three storey dwelling on all levels;
- Construction of a garden room to the rear on the eastern boundary;
- All associated conservation and repair work, landscaping to rear garden, drainage and site development works.

PROTECTED STRUCTURE: The development will consist of the following works to the three storey dwelling:
Demolition of single storey extension to rear
Construction of a new single storey extension with rooflights to the rear with new and widened opes proposed to link this element to the main house;
Construction of a dormer window and new rooflight at attic level in the main roof to rear;
Side and rear elevation changes as well as refurbishment and internal amendments to the existing three storey dwelling on all levels;
