All associated conservation and repair work, landscaping to rear garden, drainage and site development works.

The development will comprise: (1) The construction of a new two-storey c.16,700 sq.m building for use as electrical rooms for electronic operations, mechanical plant rooms and support areas including offices and welfare facilities, a loading bay, back-up generators and a water tank farm. The facility will also contain new external plant areas including
(2) An electrical substation;
(3) and electrical transformer compound with associated control room;
(4) A diesel fuel tank farm and loading bay with associated pump house; and
(5) A sprinkler water tank with associated pump house;
(6) A security entrance kiosk;
(7) The repositioning and widening of 2 no. vehicular and pedestrian entrances;
(8) 36 no. car parking spaces, boundary railings/fencing, landscaping and
(9) Ancillary works. Mechanical plant at roof level of the main building is screened from view on all sides. The combined gross floor area of all proposed buildings is c. 16,900 sq.m. A separate application for planning permission for the demolition of existing buildings has been lodged with Dublin City council- Reg. Ref. no. 3634/15.

The development will consist of: 
Demolition of 2 no. existing dwellings (known as Haremount, No. 726 Howth Road & Lonsdale No. 728 Howth Road) with a gross floor area of 439 sq.metres;
Construction of 16 no. houses, comprising 9 no. 4 bed houses and 7 no. 5 bed houses;
The houses are to be provided as follows: 9 no. house type A units consisting of 2 storey 4 bed semi-detached/terraced houses of c.156 sq.m; 4 no. house type B units consisting of 3 storey (including dormers at 2nd floor level) 5 bed semi-detached houses of c. 209 sq.m; 3 no. house type C units consisting of 3 storey (including dormers at 2nd floor level) 5 bed semi-detached/terraced houses of c. 193 sq.metres;
Revised boundary treatment including construction of new front boundary wall and railings;
All associated site and infrastructural works including foul and surface water drainage, surface car parking, landscaping (hard and soft), boundary treatment, new internal roads, and footpaths.

PROTECTED STRUCTURE:(RPS no.: 7765 within Grafton Street & Environs Architectural Conservation Area). It is proposed to carry out the following works to the signage on the front elevation, together with all associated site works:
- Install LED Linear Strip to internal face of windows;
- Replace existing signage with front illuminated signage, heights capped to match existing;
- Replace existing 'Bus Stop' sign with new illuminated TopShop/ Miss Selfridge Bus Stop sign horizontally orientated.

PROTECTED STRUCTURE: The Provost, Fellows, Foundation Scholars and the other members of Board of the College of the Holy and Undivided Trinity of Queen Elizabeth near Dublin, College Green, Dublin 2 intend to apply for permission for development at this site, c. 0.35 ha site at Oisin House, 212-213 Pearse Street, Dublin 2 and the Printing House (Protected Structure - Ref. No. 2003) located to the south of Oisin House, within the campus of Trinity College Dublin, Dublin 2.
The proposed development comprises the following:
(i) The demolition of the existing Oisin House (6,396 sq.m gross floor area in 5 no. storeys plus roof plant level over basement), 2 no. later 3 no. storey ancillary extensions (totalling 887.4 sq.m gross floor area) to the Printing House (Protected Structure), existing single storey stores adjacent to the Pearse Street gate of Trinity College (108 sq.m gross floor area) and sundry walls/ gates within the site;
(ii) The temporary removal of the Pearse Street gates of Trinity College Dublin (Protected Structure - Ref. No. 2001), including the two piers of the perimeter wall to the east as far as the boundary of Oisin House during the development period. The piers and the gate will be reinstated as existing on completion of the works on the site;
(iii) The construction of a stone and granite building with a gross floor area of 13,825.4 sq.m comprising 7 no. storeys above ground level with additional plant spaces enclosed in the roof structure (27.5 m max.in height above ground level or 31.62 m Ordnance Datum) and 2 no. basement levels. The building will include: 278 no. student accommodation bed spaces; ancillary services including laundry, security/ porters office, seminar rooms, common rooms, comms rooms, refuse facilities; a medical facility/ wellness centre (975 sq.m gross floor area); 3 no. ancillary retail service units at ground floor level (totalling 149 sq.m gross floor area); student support services including disability offices, technology assistant offices and an estate management facility including a workshop delivery bay and a goods lift; sports and recreational facilities (1,074 sq.m gross floor area) located at the 2 no. basement levels; 140 no. bicycle parking spaces and 2 no. courtyards one at ground floor level off the street and another at first floor level;
(iv) Sundry repairs to the Printing House related to the removal of the Printing House extensions, including works to the roof, repair of timber cornices, the removal of modern render and cleaning of the building, the removal of plaster residue, stone repairs, the reinstatement of glazing to original and altered window opes revealed by the removal of the Printing House extension as well as the external redecoration of the existing window opes. The works to the Printing House will also include the excavation of the original basement at the eastern elevation, the construction of a retaining wall and the provision of railings, the provision of a new door to the north elevation and the reduction of the ground level in front of the southern entrance to uncover/ reinstate the original steps at this location.
(v) The change of use of 3 no. existing parking spaces to provide 3 no. disabled parking spaces to the South of the Printing House;
(vi) Landscaping including public and private open spaces, foul and surface water sewers, works to the public road subject to agreement with the roads authority and all other associated site services, site infrastructure and site development works.

Hibernia REIT plc intend to apply for a 10 year planning permission for development at a 0.38 hectare site. The proposed development comprises of Phase 2 of the redevelopment of the overall site (Phase 1 is permitted under Reg.Ref.: 2527/15). The proposed development also includes minor amendments to the permitted Phase 1 to allow integration with the proposed Phase 2 development. The proposed development consists of the following:
- Demolition of existing buildings on the site and the existing wall to Charlotte Way.
- The development of a mixed use development of seven storeys above ground, with a setback at seventh storey ( sixth floor), a lower ground floor level for office accommodation, all above 1 no. basement level, comprising of 16,630 sq.m total gross floorspace. The development comprises of 1,115 sq.m gross of retail/ retail services/ café/ restaurant floorspace at ground floor level to Charlotte Way, including provision of an outdoor seating area, and 15,515 sq.m of office floorspace. Roof terraces are provided at sixth floor level on the south, east and west elevations. Plant enclosures and a green roof will be provided at roof level;
- Provision of a landscaped open space area to Harcourt Street and public realm upgrades to Charlotte Way;
- Provision of a vehicular link from Charlotte Way to basement level to serve the proposed Phase 2 and the permitted Phase 1 development and the omission of the permitted vehicular entrance from Harcourt Street as permitted under Phase 1; The proposed Phase 2 basement comprises of 43 no. car parking spaces, 166 bicycle parking spaces, shower, changing and locker facilities, loading bays, plant areas, waste storage and other ancillary areas; 
- Amendments to the permitted Phase 1, including amendments to the permitted southern facade to provide integration with the proposed Phase 2 development; The development includes all associated site development works, hard and soft landscaping and all other ancillary works.

Findlater House Ltd. wish to apply for planning permission at a 0.21 hectare site. The application site is located on O'Connell Street, Findlater Place on Cathal Brugha Street, Dublin 1. The proposed development comprises of amendments to Reg.Ref.: 3181/13 (previously amended under Reg. Ref.: 3438/15) which relates to the change of use from office to hotel, the provision of an additional storey and other ancillary and associated works. The proposed amendments to the permitted development comprise of the following:
- Amendment to basement layout and increase in size of basement area for hotel into previously unused basement area to increase size of hotel basement from 217 sq.m gross to 493 sq.m gross, to accommodate plant areas, additional meeting rooms, storage and associated facilities for the hotel; 
- Reduction in the size of the permitted café unit at ground floor level from 253 sq.m to 103 sq.m gross and associated increase in size of hotel at ground floor level;
- Provision of external seating area for use by the café unit;
- Minor amendments to elevations comprising of relocation of fire exit door, increase in size to provide a double fire exit door at ground floor to Cathal Brugha Street/ Findlater Place elevation and removal of stepped entrance to fire escape doors;
- All associated and ancillary works including associated minor amendments to elevations.

RETENTION: The proposed development comprise external alterations and extension of the existing building to include:
(a) Removal of part of existing ground floor eastern elevation/facade (onto Waterloo Road) and the entire ground floor northern elevation/facade (onto Baggot Street) and replacement of same with new shop front units comprising full height, powder coated aluminium framed glazed units (No.13 in total); 
(b) Removal of existing main entrance and staircore facade to eastern elevation (onto Waterloo Road) from ground level to fourth floor level (from level 8.69m to level 33.21) to provide a reconfigured staircore and entrance lobby with new projecting Curtain Wall glazing system measuring approximately 7.964m in width together with new revolving entrance door at ground floor level and stone surround to an existing wall mounted ATM to the north thereof. Retention permission for this existing ATM is also sought;
(c) Public realm improvements at ground level along Waterloo Road frontage to the front of the building include the provision of new hard and soft landscaping works and the provision of new steps and disabled access ramp leading to front door and the replacement of existing bollards with removable stainless steel bollards; and 
(d) Provision of a single storey detached shower room (53.81sq.m) at ground floor level to the rear (west) of the building to provide ancillary shower, changing and w/c staff facilities.

The application site is located to the east of Love Lane East and to the south of the residential development know as "The Northumberland's". 
The development provides for improvement and refurbishment works to the existing office building to include:
(i) Replacement glazing and cleaning of brickwork;
(ii) New entrance feature and canopy to the front (south) elevation including signage;
(iii) Amendments to roof plant layout including timber screen to plant area, new deck terrace area and railing and canopy to front elevation at roof level;
(iv) New non-illuminated building address signage at fourth floor level to side (west) elevation;
(v) New steel railing at ground floor level;
(vi) External staircase to landscaped garden at podium level;
(vii)ESB substation and swiitchroom
(viii) All associated ancillary works.

PROTECTED STRUCTURE: The development will consist of the provision of a total of 101 no. residential units, the part change of use and part conversion of existing Protected Structure and a new residential nursing home. The development comprises:
(1) The demolition of existing 1 no. gate lodge dwelling 1 no. existing outbuilding / shed, and parts of Protected Structure; 
(2) The part change of use and part conversion of the existing 2-3 storey Protected Structure from convent to residential use with existing church to be retained in full. Internal and external alterations / modifications to existing Protected Structure are also proposed to accommodate residential use. The Protected Structure will now comprise institutional / ecclesiastical and community use on ground, first and second floor with the remaining structure comprising 6 no. apartments (2 no. 1 bed, 2 no. 2 bed & 2 no. 3 bed units) and 3 no. 3 bed, 2 storey terraced dwellings. The existing 1 no. detached 2 bed bungalow associated with Protected Structure, part of walled garden and burial ground are to be retained with new wall to be constructed around burial ground. Alterations to boundary of walled garden are also proposed.
(3) The construction of 55 no. residential dwellings as follows; 8 no. semidetached 3 storey (2no. 4 bed & 6 no. 5 bed) dwellings, 47 no terraced 3 storey (16 no. 4 bed & 31 no. 5 bed) dwellings;
(4) The construction of 2 no. apartment blocks as follows- Block A - 3 storey with underground basement car park providing for 16 no. units (2 no. 1 bed apartment units  12 no. 2 bed apartment units and 2 no. 3 bed apartment duplex units) all with balconies; Block B- 4storey with underground basement car park providing for 20 no. units (2 no. 1 bed units, 16 no. 2 bed units & 2 no. 3 bed units) all with balconies; 
(5) The construction of a 4 storey, 69 bedroom residential nursing home with roof garden and associated ancillary / common facilities and office / administration areas;
(6) The construction of 2 no. basement car parks - 1 no. serving apartment Block B and nursing home comprising 64 no. car parking spaces ( 30 no. designated for residential use and 34 no. spaces for nursing home) and 32 no. bicycle spaces, and 1 no. serving apartment Block A and units within existing Protected Structure comprising 35 no. car parking spaces and 22 no. bicycle spaces. 113 no. surface car parking spaces to serve dwellings. 6 no. surface visitor car parking spaces to serve institutional / ecclesiastical and community use ( total no. of spaces - 226);
(7) Construction of 2 no. new vehicular and pedestrian access points on Grace Park Road with existing entrance to be closed. The provision for a new pedestrian / cyclist entrance onto Griffith Avenue;
(8) 1 no. esb substation;
(9) Boundary treatments including partial removal of boundary wall along Grace Park Road to provide sightlines and footpath, removal of later additions of boundary wall on Grace Park Road and Griffith Avenue with the existing stone / brick to be reused within development and the relocation of existing piers and gate for reuse within development; 
(10) Landscaping (including playground), engineering and all site development works necessary to facilitate the development.

Planning permission for the following works on existing two-storey four-bedroom detached dwelling.
(i) Partial demolition of an existing single-storey extension to the rear with pitched roof, partial demolition of an existing garage & the demolition of two flat-roofed sheds to the side (north) of the house, demolition of three existing chimney stacks down to roof level;
(ii) construction of a new single-storey extension to the side (north) & rear (west) of the house, part with mono-pitched roof and part with flat roof, with both roof sections to feature roof windows;
(iii) provision of two new roof windows to rear (west) slope of the existing main roof;
(iv) provision of new solar panels to the side (south facing) slope of the existing main roof;
(v) provision of one new metal flue to the side (south facing) slope of the existing main roof to replace a chimney being demolished;
(vi) provision of a new window at first floor level to the side (north) elevation of the main house;
(vii) provision of two new windows at ground floor level to the side (south) elevation of the main house;
(viii) reconfiguration of windows at first floor level to the rear (west) elevation of the main house to include blocking-up an existing bathroom window, and enlarging an existing window to the stairs/landing;
(ix) provision of a new higher garden wall & side gate to the side (south) of the existing house;
(x) widening the existing vehicular entrance gate (accessed from Belgrove Park);
(xi) removal of existing columns, and provision of new steps and landing at the main front entrance (east) of the existing main house;
(xii) other internal refurbishments of the existing extended house and
(xiii) other site works to facilitate the development.
17 Belgrove Park, Chapelizod, Dublin 20 is a corner site where Belgrove Park continues around the bend in the road.

