The development will consist of the installation new and replacement building signage comprising:
1. Individually applied backlit letters in a combination of black and bronze finishes on the eastern elevation facing Guild Street adjacent to the southern corner approximately 13.6 metres above ground level (replacement of existing signage); on the western elevation facing the access road adjacent to the southern corner approximately 13.3 metres above ground level (replacement of existing signage); and on the southern elevation facing the rear of North Wall Quay adjacent to the southern corner approximately 13.6 metres above ground level (new signage);
