Site of c0.385 ha at 1-6 Wilton Terrace (formerly Fitzwilton House), bounded by Wilton Terrace, Cumberland Road and Lad Lane Upper, Dublin 2. Site of c0.385 ha at 1-6 Wilton Terrace (formerly Fitzwilton House), bounded by Wilton Terrace, Cumberland Road and Lad Lane Upper, Dublin 2 The development proposes the demolition of the existing office development on the site (c. 8,513 m2 [+ basement level] ranging from 3 to 12 storeys [12m to 38m] in height) and the construction of a new office development c. 17,405 m2 [ + 2 basement levels] ranging from 4 to 8 storeys [17m to 33m] in height) including the following elements:1) Two basement levels (c. 3,557 m2) including 44 No. car spaces ( access via ramp from Wilton Terrace), 178 no. bicycle spaces, plant, waste and ancillary areas;2) Landscaping within the site area (including provision of gardens and terraces at Lower Ground, Ground, Fourth, Seventh and Roof Levels);3) Resurfacing and upgrading and landscaping of adjacent public areas outside the site ownership boundary (including widening part of Lad Lane to create a pedestrian footpath with tree planting, removal of 3 No. parking spaces on Cumberland Road to create a service / delivery loading zone, a new loading zone on Wilton Terrace for waste collection and provision of a [2 car] set down area on Wilton Terrace and associated relocation of the existing coach parking bay; all subject to the agreement of Dublin City Council);
