5) public artworks at the south of the site;
6) and provision of an ESB substation, 31 No. surface level visitor bicycle spaces, external furniture and lighting to landscaped areas and of all associated and ancillary development and site works above and below ground.

Demolition of existing fire damaged/ derelict, 2-storey over basement public house (105 & 107 Emmet Road, formerly 'The Horse and Jockey') and adjacent dwelling (109 & 111 Emmet Road) and the construction of a 3 storey over basement mixed use development, stepped at rear, comprising:
(a) accommodation for 40 students with single and twin bed en-suite rooms and shared kitchen / living/ dining accommodation contained in 'house units' on 3 storeys over basement level;
(b) the replacement of disused bar and lounge at ground floor level with a commercial/ retail unit;
(c) bicycle store, bin store, study room, games and seminar room, management office, laundry and drying room at basement level serving the student accommodation above;
(d) outdoor recreational area at rear (north) of the proposed building and
(e) the relocation of a public overflow sewer from no. 107 Emmet Road to adjoining open space at 103 Emmet Road.

The development will consist of installation new and replacement building signage comprising:
1. Individually applied backlit letters in a combination of black and bronze finishes on eastern elevation facing Guild Street adjacent to the southern corner approximately 13.6 metres above ground level ( replacement of existing signage); on the western elevation facing the access road adjacent to the southern corner approximately 13.3 metres above ground level ( replacement of existing signage); and on the southern elevation facing the rear of 30 North Wall Quay adjacent to the southern corner approximately 13.6 metres above ground level ( new signage);
2. Individual letters in a combination of black and bronze finishes applied to the glazed section of the entrance at ground floor on the western elevation facing Guild Street approved under register reference 3320/15.

The development will consist of:
Demolition of the existing single storey extensions to the side and rear of the existing hipped roof, dormer bungalow; 
Construction of a new single storey extension to the side with hipped roof, single storey extension to the rear with part hipped roof, part flat roof and construction of a single storey garden room to the rear of the site with monopitch, along with all associated site works.

The development will consist of the demolition of all existing structures on site, sewer diversion works and boundary treatments including:
demolition of brick perimeter wall and structures fronting Sir John Rogerson's Quay and extending along Lime Street;
Demolition of warehouse structures located behind buildings fronting Sir John Rogerson's Quay and adjoining Whitaker Lane;
Demolition of two-storey brick built warehouse fronting Lime Street and associated perimeter walls and storage buildings;
Demolition of former commercial buildings located behind buildings fronting Hanover Street East and yards associated with the established use;
Demolition of walls to street level at Whitaker Lane frontage;
